%% @doc Default Unicode Collation Element Table (DUCET) - non-tailored.

-module(erluca_util).
-compile([{hipe,[{regalloc,linear_scan}]}]).

%% ====================================================================
%% API functions
%% ====================================================================
-export([spec_version/0]).
-export([lookup/1]).
-export([in_table/1]).
-export([is_variable/1]).

-export([discontiguous_match/1]).
-export([discontiguous_match/2]).

spec_version() -> {10,0}.

% primary weight states if variable or not. type? punct/curr/etc.
is_variable(N) when N >= 16#0201, N =< 16#1C5B -> true;
is_variable(_) -> false.

discontiguous_match([A|C]) ->
   {Ns,Rest} = unblocked_non_starters(C,0,[]),
   get_first_match(A, Ns, [], Rest).

discontiguous_match(A,[B|C]) ->
   {Ns,Rest} = unblocked_non_starters(C,0,[]),
   get_first_match([A,B], Ns, [], Rest).

unblocked_non_starters([],_,Acc) ->
   {lists:reverse(Acc),[]};
unblocked_non_starters([H|T],Last,Acc) ->
   #{ccc := CCC} = unicode_util:lookup(H),
   if CCC > Last ->
         unblocked_non_starters(T,CCC,[H|Acc]);
      true ->
         {lists:reverse(Acc),[H|T]}
   end.

get_first_match(_,[],Acc,Str) ->
   {false, Acc ++ Str};
get_first_match(L,[N|R],Acc,Str) when is_list(L) ->
   case in_table(L++[N]) of
      true ->
         {true, L++[N|R] ++ Acc ++ Str};
      _ ->
         get_first_match(L,R,Acc ++ [N],Str)
   end;
get_first_match(L,[N|R],Acc,Str) ->
   case in_table([L,N]) of
      true ->
         {true, [L,N|R] ++ Acc ++ Str};
      _ ->
         get_first_match(L,R,Acc ++ [N],Str)
   end.

