% Tangut
lookup([O|R]) when O >= 16#17000, O =< 16#18AFF ->
   A = 16#FB00,
   B = (O - 16#17000) bor 16#8000,
   [{A,16#0020,16#0002},{B,16#0000,16#0000}|lookup(R)];
% Nushu
lookup([O|R]) when O >= 16#1B170, O =< 16#1B2FF ->
   A = 16#FB01,
   B = (O - 16#1B170) bor 16#8000,
   [{A,16#0020,16#0002},{B,16#0000,16#0000}|lookup(R)];
% Core Han Unified Ideographs
lookup([O|R]) when O >= 16#4E00, O =< 16#9FEA;
                   16#FA0E;16#FA0F;16#FA11;16#FA13;16#FA14;16#FA1F;16#FA21;
                   16#FA23;16#FA24;16#FA27;16#FA28;16#FA29 ->
   A = 16#FB40 + (O bsr 15),
   B = (O band 16#7FFF) bor 16#8000,
   [{A,16#0020,16#0002},{B,16#0000,16#0000}|lookup(R)];
% All other Han Unified Ideographs
lookup([O|R]) when O >= 16#3400 , O =< 16#4DB5 ;
                   O >= 16#20000, O =< 16#2A6D6;
                   O >= 16#2A700, O =< 16#2B734;
                   O >= 16#2B740, O =< 16#2B81D;
                   O >= 16#2B820, O =< 16#2CEA1;
                   O >= 16#2CEB0, O =< 16#2EBE0 ->
   A = 16#FB80 + (O bsr 15),
   B = (O band 16#7FFF) bor 16#8000,
   [{A,16#0020,16#0002},{B,16#0000,16#0000}|lookup(R)];
% Unknown
lookup([O|R]) ->
   A = 16#FBC0 + (O bsr 15),
   B = (O band 16#7FFF) bor 16#8000,
   [{A,16#0020,16#0002},{B,16#0000,16#0000}|lookup(R)];
lookup([]) -> [].